import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from "./Pages/Home"

render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home />}>


      </Route>
    </Routes>
  </BrowserRouter>,
  document.getElementById("root")
);
export default App;
